snippet.textDisplay:
@James Ytez la guerra de clases existe en las personas que tienen envidia y odio guardado. Si tu vives tu vida, no te tiene que preocupar de la de los demás.

Todos los partidos que se encuentran en españa gobernando son criticables y deben ser criticados porque la gestión ha sido horrible a todos los niveles. Que se centre en el gobierno de España porque es el que más responsabilidad ha tenido me parece normal. 

No me parece bien que generalices así. La policía de los balcones podría ser gente totalmente diferente a la que está en la calle ahora manifestandose o podrían ser los mismos. No lo sabemos y por tanto, mejor no relacionar una cosa con la otra.

